import React from "react";
import { useLocation } from "react-router-dom";

const ImageResult = () => {
    const location = useLocation();
    const img = { ...location.state };

    return (
        <div>
            <img src={img} alt="result"></img>
        </div>
    )
}

export default ImageResult;
